import React from 'react';
import { TableRow, TableCell, Button } from '@mui/material';

const TableRowComponent = ({ row, onDelete }) => {
  return (
    <TableRow>
      <TableCell>{row.orderNumber}</TableCell>
      <TableCell>{row.dateCreated}</TableCell>
      <TableCell>{row.status}</TableCell>
      <TableCell>{row.documentCost}</TableCell>
      <TableCell>{row.phoneRecipient}</TableCell>
      <TableCell>{row.recipientFullName}</TableCell>
      <TableCell>{row.costOfGoods}</TableCell>
      <TableCell>
        <Button onClick={() => onDelete(row.id)} color="secondary" variant="contained">
          Удалить
        </Button>
      </TableCell>
    </TableRow>
  );
};

export default TableRowComponent;
